import React from 'react'

const Sresult = (props) => {

    const imgs = `https://unsplash.com/s/photos/person/480x480?${props.name}`
  return (
    <>
        <div>
            <img src={imgs} alt='abh'/>
        </div>
    </>
  )
}

export default Sresult
